# Definition for singly-linked list.# class ListNode:#     def __init__(self, x):#         self.val = x#         self.next = Noneclass Solution:    def swapPairs(self, head):        """        :type head: ListNode        :rtype: ListNode        """        dummy=pre=ListNode(-1)        pre.next=head        while pre.next and pre.next.next:            a=pre.next            b=a.next            pre.next,a.next,b.next=b,b.next,a            pre=a        return dummy.nexts=Solution()print(s.spiralOrder([[1,2,3],[4,5,6],[7,8,9]]))